package com.yao.app.algorithm;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution438 {

    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        int m = s.length();
        int n = p.length();

        Map<Character, Integer> countMap = new HashMap<>((int) (n / 0.75 + 1));
        for (int i = 0; i < n; i++) {
            char ch = p.charAt(i);
            plusCount(countMap, ch);
        }

        Map<Character, Integer> windowCountMap = new HashMap<>((int) (n / 0.75 + 1));
        int left = 0, right = 0;
        int valid = 0;
        boolean foundFirst = false;
        while (right < m) {
            char ch = s.charAt(right);
            // 进行窗口内数据的一系列更新
            if (countMap.containsKey(ch)) {
                if (!foundFirst) {
                    foundFirst = true;
                    left = right;
                }
                int nowCount = plusCount(windowCountMap, ch);
                int count = countMap.get(ch);
                if (nowCount == count) {
                    valid++;
                } else if(nowCount == count + 1) {
                    valid--;
                }
            } else {
                foundFirst = false;
                windowCountMap.clear();
                valid = 0;
                right++;
                continue;
            }

            if (valid == countMap.keySet().size()) {
                result.add(left);
            }

            // 判断左侧窗口是否要收缩,窗口内出现字符个数超标
            while (windowCountMap.get(ch) > countMap.get(ch)) {
                char d = s.charAt(left);
                left++;
                // 进行窗口内数据的一系列更新
                int nowCount = minusCount(windowCountMap, d);
                int count = countMap.get(d);
                if (nowCount == count) {
                    valid++;
                } else if(nowCount == count - 1) {
                    valid--;
                }

                if (valid == countMap.keySet().size()) {
                    result.add(left);
                }
            }

            right++;
        }
        // 未找到符合条件的子串
        return result;
    }

    private int plusCount(Map<Character, Integer> countMap, char ch) {
        Integer count = countMap.get(ch);
        if (count == null) {
            count = 0;
        }
        count++;
        countMap.put(ch, count);
        return count;
    }

    private int minusCount(Map<Character, Integer> countMap, char ch) {
        Integer count = countMap.get(ch);
        if (count == null) {
            count = 0;
        }
        count--;
        countMap.put(ch, count);
        return count;
    }

    public static void main(String[] args) {
        Solution438 test = new Solution438();
/*        List<Integer> result = test.findAnagrams(
            "",
            "");
        */
        List<Integer> result = test.findAnagrams("ababababab","aab");
        System.out.println(result);
    }

}
